//this will allow us to use these colors throughout. It will allow us
//to come here and change them instead of having to go look for them line
//by line.

export default {
    primary: "#22CA7B",
    secondary: "blue",
    backGroundOne: "white",
    backGroundTwo: "#F3F3F3",
    shadowOne: "black",
    shadowTwo: "grey",
};
